import React, { useState } from "react";
const App = ()=>{
    const[First,setFirst]=useState()
    const[Fname,setFname]=useState()

    const[Second,setSecond]=useState()
    const[Lname,setLname]=useState()

    const[Third,setThird]=useState()
    const[email,setemail]=useState()

    const run=(e)=>{
        e.preventDefault();
        setFname(First);
        setLname(Second);
        setemail(Third);
    }

    const first=(e)=>{
        setFirst(e.target.value)
    }
    const last=(e)=>{
        setSecond(e.target.value)
    }
    const Email=(e)=>{
        setThird(e.target.value)
    }

    return(
        <>
        <form onSubmit={run}>
            <div>
                <h1>{Fname}{Lname}</h1><br /><p>{email}</p>

                <input 
                required
                type="text" 
                onChange={first} 
                defaultValue=""
                value={First}
                placeholder="Enter Your First Name"    
                />

                <input 
                required
                type="text" 
                onChange={last} 
                defaultValue=""
                value={Second}
                placeholder="Enter Your First Name"    
                />

                <input 
                required
                type="email" 
                onChange={Email} 
                defaultValue=""
                value={Third}
                placeholder="Enter Your First Name"    
                />

                <button type="submit">Click Me!</button>


            </div>
        </form>
        </>
    )
}
export default App
